    const navigate=useNavigate()

    return(
        <Fragment>
            <div className={style}>
                {
                    sidebar_arr.map((item,index)=>(
                        <div><NavLink to={`/backend/${item}`}item >{item}</NavLink></div>
                        )
                    )
                }
            </div>


        </Fragment>
    )
}
export default Sidebar;
